import React from 'react'

function handleSubmit(e) {
    e.preventDefault();
    console.log('You clicked submit.');
  }

function Login(){
    return(
        <div className='d-flex justify-content-center align-items-center bg-primary vh-100'>
            <div className='bg-white p-3 rounded w-25'>
                <form action=''>
                    <div className='mb-3'>
                        <label htmlFor='email'>Email</label>
                        <input type='email' placeholder='email' className='form-control rounded-0'></input>
                    </div>
                    <div className='mb-3'>
                        <label htmlFor='password'>Password</label>
                        <input type='password' placeholder='password' className='form-control rounded-0'></input>
                    </div>
                    <button className='btn btn-success w-100'>Inicio sesion</button>
                    <p>Holaaaa</p>
                    <button onClick={handleSubmit} className='btn btn-default border w-100 bg-light text-decoration-none '>Registrarse</button>

                </form>
            </div>
        </div>
    )
}
export default Login;
